// import "./App.css";
import ProductList from "./Components/ProductList";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  return (
    <Router>
      <Routes>
        <Route exact path="http://localhost:3000/" element={<ProductList />} />
      </Routes>
    </Router>
  );
}

export default App;
